import React from 'react';

const Login = ({ history }) => {
  const handleLogin = () => {
    // Simulate login logic, for simplicity, just redirect to home
    history.push('/ome');
  };

  return (
    <div>
      <h1>Login Page</h1>
      <label>Username : <input type="text"/> </label><br></br><br></br>
      <label>Password : <input type="password" /></label><br></br><br></br>
      <button onClick={handleLogin}>Login</button>
    </div>
  );
};

export default Login;
